function PageChange(pageId) {
var htm = '';
for (j = 0; j < detailData[pageId].length; j++) {
htm += detailData[pageId][j];
}
top.contents.details.document.getElementById('id_detail').innerHTML = htm;
htm = "<center><table border='0' cellpadding='3' style='font-size: 10pt;'>";
htm += "<tr>";
htm += "<td class='menu2' style='min-width:40px;width:40px;'>Turn</td>";
htm += "<td class='menu2' style='min-width:170px;width:170px;'>Skill</td>";
htm += "<td class='menu2' style='min-width:50px;width:50px;'>BP</td>";
htm += "<td class='menu2' style='min-width:55px;width:55px;'>Damage</td>";
htm += "<td class='menu2' style='min-width:55px;width:55px;'>BP変化</td>";
htm += "<td class='menu2' style='min-width:600px;width:600px;'>備考</td>";
htm += "</tr>";
for (j = 0; j < resultData[pageId].length; j++) {
if (j % 6 == 0) { htm += "<tr><td class='menu'>" + resultData[pageId][j] + "</td>" }
else if (j % 6 == 5) { htm += "<td class='menu3'>　" + resultData[pageId][j] + "</td></tr>" }
else { htm += "<td class='menu'>" + resultData[pageId][j] + "</td>" }
}
top.contents.results.document.getElementById('id_result').innerHTML = htm;
}
